-- 标签商品关联表
DROP TABLE IF EXISTS beiker_biaoqian_goods;
CREATE TABLE beiker_biaoqian_goods(
 id INT(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
 goodsid INT(11) UNSIGNED NOT NULL COMMENT '商品id',
 biaoqianid INT(11) UNSIGNED NOT NULL COMMENT '标签id,关联beiker_biaoqian_property id',
 createdate TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
 isavailable ENUM('y','n') NOT NULL COMMENT '是否可用y:可用,n:不可用', PRIMARY KEY(`id`)
) COMMENT='商品标签关系表' COLLATE='utf8_general_ci' ENGINE=InnoDB;


-- 标签属性表

DROP TABLE IF EXISTS beiker_biaoqian_property;
CREATE TABLE beiker_biaoqian_property(
 id INT(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
 tagname VARCHAR(20) NOT NULL COMMENT '标签中文名',
 tag_enname VARCHAR(20) NOT NULL COMMENT '标签英文名',
 parentid INT(11) UNSIGNED NOT NULL COMMENT '父类id', PRIMARY KEY(`id`)
) COMMENT='标签属性' COLLATE='utf8_general_ci' ENGINE=InnoDB;



