-- 折扣率、评价值排序

ALTER TABLE beiker_catlog_good ADD COLUMN discountrate FLOAT(4,1) UNSIGNED NOT NULL DEFAULT '0.0' COMMENT '折扣率'; 
ALTER TABLE beiker_catlog_good ADD COLUMN rating FLOAT(5,4) UNSIGNED NOT NULL DEFAULT '0.0' COMMENT '好评率';


--  导入beiker_catlog_good 表的折扣率
UPDATE beiker_catlog_good bcg , beiker_goods bg SET bcg.discountrate = bg.discount
		WHERE bcg.goodid=bg.goodsid;
















